import React from 'react';

export default class Skills extends React.Component {
  render() {
    return(
      <div class="about_skills">
        <div class="about_left">
          <h1>Professional Skills</h1>
          <ul>
            {this.props.info.map((item, index) => (
              <Progress id={index} bar={item.name} percent={item.percent} />
            ))}
          </ul>
        </div>
        <div class="about_right"></div>
      </div>
    );
  }
}

class Progress extends React.Component {
  render() {
    const width = {
      width : `${this.props.percent}%`
    }
    return(
      <>
        <li>{this.props.bar}</li>
        <div className="bar">
          <div style={width}></div>
        </div>
      </>
    )
  }
}



class Work extends React.Component {
  render() {
    return(
      <div class="about_work">
        <div class="work_block">
        {this.props.info.map((item, index) => (
          <WorkItem id={index} name={item.name} numb={item.numb} picture={item.pic} />
        ))}
        </div>
      </div>
    );
  }
}

class WorkItem extends React.Component {
  render() {
    return(
      <span className={`pe-7s-${this.props.picture}`}>
      <div class="work_numbers">
          <div class="numb">{this.props.numb}</div>
          <div class="work_name">{this.props.name}</div>
        </div>
      </span>
    )
  }
}
